      SELECT - - 41 * - col2 + + col0 + col2 * - col2 / - col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN 90 * col0 AND - - col2;
  - name: tab1

outputs:
  - name: q3916.out
    data: |
